after:
public PrestoSparkRow get()
        throws InterruptedException
{
    PrestoSparkRow row = null;
    synchronized (monitor) {
        while (buffer.isEmpty() && !finished) {
            monitor.wait();
        }
        if (!buffer.isEmpty()) {
            row = buffer.poll();
        }
    }
    if (row != null) {
        memoryManager.updateMemoryUsage(-row.getRetainedSize());
    }
    return row;
}

