    if (str == null || str.isEmpty() || len == 0) {
        return "";
    }

    if (len > 0) {
        return str.substring(0, Math.min(len, str.length()));
    }

    final int finalLen = str.length() + len;
    return finalLen > 0 ? str.substring(0, finalLen) : "";
}

